sys_variable_value.value:
(function execute(inputs, outputs) {

  var field = inputs.field + ":";
  var body = inputs.email_body;
  var body_array = body.split("\n");

  for (var i = 0; i < body_array.length; i++) {
      if (body_array[i].indexOf(field) != -1) {
          outputs.value = body_array[i].split(field)[1].split("<")[0];
      }
  }

})(inputs, outputs);

